import styled from "styled-components";

const Barra = styled.div`
   padding-bottom: 2%;
`

export default function SearchBar({OnSearch}) {
   return (
      <Barra>
          <input type='search' />
         <button onClick={(id) =>{OnSearch(id)}}>Agregar</button>
      </Barra>
   );
}
